const count = 5;

export default function reducer(state = count, action) {
  switch (action.type) {
    case "increment":
      return state + 1;
    case "decrement":
      return state - 1;
    case "amount":
      const val = action.payload;
      return [...state, count + 3];

    default:
      return state;
  }
}
